        public async Task<Result<bool>> Coflow1_1_CreateVisit(int requestOfStaff, int requestOfSecurity)
        {
            var visitors = (await _visitorRepo.FindAsync(s => s.CredentialsCard == "MockCCCD", int.MaxValue)).ToArray();
            for (var i = 0; i < requestOfStaff; i++)
            {
                if(i > visitors.Count())
                {
                    break;
                }
                var visitCommand = new VisitCreateCommandDaily()
                {
                    VisitName = "Visit " + Guid.NewGuid(),
                    ExpectedStartTime = DateTime.Now.AddDays(3-i),
                    ExpectedEndTime = DateTime.Now,
                    Description = "VisitMock",
                    CreateById = 4,
                    ResponsiblePersonId = 4,
                    VisitQuantity = 1,
                    VisitDetail = new List<VisitDetailOldCommand>
                    {
                        new VisitDetailOldCommand
                        {
                            VisitorId = visitors[i].VisitorId,
                            ExpectedStartHour = TimeSpan.Parse("07:00:00"),
                            ExpectedEndHour = TimeSpan.Parse("12:00:00"),
                            Status = true
                        }
                    }
                    
                };
                await CreateVisitDaily(visitCommand, UserRoleEnum.Staff.ToString());
            }
            for (var i = 0; i < requestOfSecurity; i++)
            {
                if (i > visitors.Count())
                {
                    break;
                }
                var visitCommand = new VisitCreateCommandDaily()
                {
                    VisitName = "Visit " + Guid.NewGuid(),
                    ExpectedStartTime = DateTime.Now.AddDays(3 - i),
                    ExpectedEndTime = DateTime.Now,
                    Description = "VisitMock",
                    CreateById = 6,
                    ResponsiblePersonId = 4,
                    VisitQuantity = 1,
                    VisitDetail = new List<VisitDetailOldCommand>
                    {
                        new VisitDetailOldCommand
                        {
                            VisitorId = visitors[i+5].VisitorId,
                            ExpectedStartHour = TimeSpan.Parse("13:00:00"),
                            ExpectedEndHour = TimeSpan.Parse("17:00:00"),
                            Status = true
                        }
                    }

                };
                await CreateVisitDaily(visitCommand, UserRoleEnum.Security.ToString());
            }

            return true;
        }

