        public async Task<Result<bool>> Coflow1_2_RejectVisitOfSecurity(int requestId)
        {
            var visitsFromSecurity = await _visitRepo.FindAsync(s => s.Description == "VisitMock" && s.VisitStatus == VisitStatusEnum.ActiveTemporary.ToString(), 4);
            foreach (var visit in visitsFromSecurity)
            {
                await _visitService.ReportVisit(visit.VisitId);
            }
            var visitsFromSecurity1 = await _visitRepo.FindAsync(s => s.Description == "VisitMock" && s.VisitStatus == VisitStatusEnum.ActiveTemporary.ToString(), 1);
            foreach (var visit in visitsFromSecurity1)
            {
                await _visitService.ActiveVisit(visit.VisitId);
            }
            return true;
        }

        public async Task<Result<bool>> Coflow1_3_CancelVisit(int requestId)
        {
            var visits = await _visitRepo.FindAsync(s => s.Description == "VisitMock" && s.VisitStatus == VisitStatusEnum.Active.ToString(), 2);
            foreach(var visit in visits)
            {
                await _visitService.CancelVisit(visit.VisitId);
            }
            var visitsFromSecurity = await _visitRepo.FindAsync(s => s.Description == "VisitMock" && s.VisitStatus == VisitStatusEnum.ActiveTemporary.ToString(), 2);
            foreach (var visit in visitsFromSecurity)
            {
                await _visitService.CancelVisit(visit.VisitId);
            }
            return true;
        }

