        public async Task<Result<bool>> Coflow2_3_CreateScheduleAssign(int numberOfSchedule)
        {
            var visitors = (await _visitorRepo.FindAsync(s => s.CredentialsCard == "MockCCCD", int.MaxValue)).ToArray();
            var scheduleUser = (await _scheduleUserRepo.FindAsync(s => s.Description == "MockTask", int.MaxValue)).ToArray();
            for (var i = 0; i < numberOfSchedule; i++)
            {
                if (i > visitors.Count())
                {
                    break;
                }
                if (i > scheduleUser.Count())
                {
                    break;
                }
                var visitCommand = new VisitCreateCommand()
                {
                    VisitName = "Visit " + Guid.NewGuid(),
                    ExpectedStartTime = DateTime.Now.AddDays(3 - i),
                    ExpectedEndTime = DateTime.Now.AddMonths(2),
                    Description = "VisitScheduleMock",
                    CreateById = 4,
                    ResponsiblePersonId = 4,
                    ScheduleUserId = scheduleUser[i].Id,
                    VisitQuantity = 1,
                    VisitDetail = new List<VisitDetailOldCommand>
                    {
                        new VisitDetailOldCommand
                        {
                            VisitorId = visitors[i].VisitorId,
                            ExpectedStartHour = TimeSpan.Parse("07:00:00"),
                            ExpectedEndHour = TimeSpan.Parse("12:00:00"),
                            Status = true
                        }
                    }

                };
                await CreateVisit(visitCommand, UserRoleEnum.Staff.ToString());
            }
            return true;

        }

        public async Task<Result<bool>> Coflow2_4_AcceptAndRejectTask(int numberOfReject, int numberOfAccept)
        {
            var visits = (await _visitRepo.FindAsync(s => s.Description == "VisitScheduleMock", int.MaxValue)).ToArray();
            foreach (var visit in visits.Take(numberOfAccept)) {
                await _visitService.ActiveVisit(visit.VisitId);
                await _scheduleUserService.RejectScheduleUser((int)visit.ScheduleUserId);
            }
            foreach (var visit in visits.TakeLast(numberOfReject))
            {
                await _visitService.CancelVisit(visit.VisitId);
                await _scheduleUserService.AproveScheduleUser((int)visit.ScheduleUserId);
            }
            return true;
        }

        public async Task<Result<bool>> Coflow3_1_Check_in(int numberOfCheckIn)
        {
            var visitorSessionList = new List<VisitorSession>();
            var gate = (await _gateRepo.FindAsync(s => true)).FirstOrDefault();
            var security = (await _userRepo.FindAsync(s => s.RoleId == (int)UserRoleEnum.Security && s.Status == UserStatusEnum.Active.ToString())).FirstOrDefault();
            var visitDetails = (await _visitDetailRepo.FindAsync(s => s.Visit.Description == "VisitMock" && s.Visit.VisitStatus == VisitStatusEnum.Active.ToString(),int.MaxValue)).ToArray();
            for (var i = 0; i < numberOfCheckIn; i++)
            {
                if (i > visitDetails.Count())
                {
                    break;
                }
                var visitorSession = VisitorSession.Checkin(visitDetails[i].VisitDetailId,
                              security.UserId,
                              gate.GateId
                    );
                visitorSession.Value.AddVisitorImage("CheckIn_Body", "MockImage");
                visitorSession.Value.AddVisitorImage("CheckIn_Shoe", "MockImage");
                visitorSessionList.Add(visitorSession.Value);
            }
            await _visitorSessionRepo.AddRangeAsync(visitorSessionList);
            await _unitOfWork.CommitAsync();
            return true;

        }

        public async Task<Result<bool>> Coflow4_1_Check_out(int checkInId)
        {
            var gate = (await _gateRepo.FindAsync(s => s.Status == true)).FirstOrDefault();
            var security = (await _userRepo.FindAsync(s => s.RoleId == (int)UserRoleEnum.Security && s.Status == UserStatusEnum.Active.ToString())).FirstOrDefault();
            var visitorSessions = (await _visitorSessionRepo.FindAsync(s => s.VisitorSessionsImages.Any(t=> t.ImageType == "CheckIn_Body" && t.ImageURL == "MockImage"),int.MaxValue)).ToArray();
            for (var i = 0; i < checkInId; i++)
            {
                if (i > visitorSessions.Count())
                {
                    break;
                }
                visitorSessions[i].CheckOutMock(security.UserId, gate.GateId);
                await _visitorSessionRepo.UpdateAsync(visitorSessions[i]);
            }
            await _unitOfWork.CommitAsync();
            return true;
        }

